Count of 3D Anatomical Structures

```
#+ summary: Count of 3D Anatomical Structures
#+ description: Count of 3D Anatomical Structures

PREFIX ccf: <http://purl.org/ccf/>

SELECT (COUNT(?as3d) as ?as_count)
FROM <https://purl.humanatlas.io/graph/ccf>
WHERE {
  SELECT DISTINCT ?as3d WHERE {
    ?as3d ccf:has_reference_organ ?y .
  }
}

```

Count of 3D Anatomical Structures

```
#+ summary: Count of 3D Anatomical Structures
#+ description: Count of 3D Anatomical Structures

PREFIX ccf: <http://purl.org/ccf/>
PREFIX CCF: <https://purl.humanatlas.io/graph/ccf>

SELECT ?label ?count
FROM CCF:
WHERE {
  {
    SELECT ("3D reference organs (no united)" as ?label)
      (COUNT(DISTINCT(?ref_organ)) as ?count)
    WHERE {
      ?ref_organ ccf:has_reference_organ ?ref_organ .
      FILTER(!CONTAINS(STR(?ref_organ), '/ref-organ/united-'))
    }
  }
  UNION
  {
    SELECT ("3D anatomical structures (no united)" as ?label)
      (COUNT(DISTINCT(?as3d)) as ?count)
    WHERE {
      ?as3d ccf:has_reference_organ ?y .
      FILTER(!CONTAINS(STR(?y), '/ref-organ/united-'))
    }
  }
  UNION
  {
    SELECT ("3D anatomical structures (no united and no reference organ AS)" as ?label)
      (COUNT(DISTINCT(?as3d)) as ?count)
    WHERE {
      ?as3d ccf:has_reference_organ ?y .
      FILTER(?as3d != ?y && !CONTAINS(STR(?y), '/ref-organ/united-'))
    }
  }
}
ORDER BY ?label

```

Total number of AS, CT, & B in the HRA-KG

```
#+ summary: AS, CT, & B total count
#+ description: Total number of AS, CT, & B in the HRA-KG

PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX ccf: <http://purl.org/ccf/>

SELECT (COUNT(DISTINCT ?iri) as ?cnt)
FROM <https://purl.humanatlas.io/graph/ccf>
WHERE {
  # AS
  {
    ?iri ccf:ccf_part_of [] .
  }
  UNION
  {
    [] ccf:ccf_part_of ?iri .
  }

  # CT
  UNION
  {
    ?iri ccf:ccf_located_in [] .
  }
  UNION
  {
    [] ccf:ccf_located_in ?iri .
  }

  # AS, CT, & B
  UNION
  {
    ?iri ccf:ccf_asctb_type [] .
  }
}

```

```
SELECT ?label ?count
FROM <https://purl.humanatlas.io/graph/ccf>
WHERE {
  {
    SELECT ("# Nodes" as ?label) (COUNT(DISTINCT(?s)) as ?count)
    WHERE {
      {
        ?s ?p1 [] .
      }
      UNION
      {
        [] ?p2 ?s .
        FILTER(isIRI(?s)) 
      }
    }
  }
  UNION
  {
    SELECT ("# Edges" as ?label) (COUNT(*) as ?count)
    WHERE {
      ?s ?p ?o .
    }
  }
  UNION
  {
    SELECT ("# Edge Types" as ?label) (COUNT(DISTINCT(?p)) as ?count)
    WHERE {
      ?s ?p ?o .
    }
  }
}

